Jerry Seinfeld &quot;Im telling you for the last time&quot; Live on Broadway (1998)

This is (as far as I know) the only R1 dvd version of this concert. It is fullscreen as this is an HBO special and that was how everything was on TV in 1998. This concert is a guaranteed good time for any fan of Seinfeld or stand-up comedy in general.  Enjoy, and don't forget to SEED!

Format: DVDR, NTSC, DVD5 (uncompressed)

Video:  Fullscreen (4:3) (original TV aspect ratio)

Audio:  English DD2.0

Subs:   None

